import React, { Component } from 'react';

class App extends Component {
    state = {}
    render() {
        return (
            <div>
                <h1>Hello</h1>
            </div>
        );
    }
}

export default App;



class Register extends Component {
    state = {}
    render() {
        return (
            <h1>Lol</h1>
        );
    }
}
